(136,2,2,17,'upload/attendance/20240805065851_66b015bb815ff.jpg','-6.9553755','109.978418','2024-08-05 06:58:51',1150172,'Banturan, Ketanggan, Batang, Jawa Tengah, Jawa, 51355, Indonesia','BATANG\r\nPT. WANXINDA\r\nWXD\r\nsenin,5 Agustus 2024\r\n\r\n\r\nSelamat pagi komandan,,, ijin melaporkan serah terima jaga mess sawangan dari anggota jaga malam\r\n-bima\r\n\r\n\r\nkepada anggota jaga pagi\r\n\r\n-rian\r\n\r\n\r\nKeterangannya:\r\n-Apel oleh KA jaga malam pak bima\r\n-Anggota lengkap\r\n-Taruna menonjol nihil\r\n\r\nMateri apel:\r\n\r\n-laksanakan tugas sesuai sop dan kedepankan S5 dalam pelayanan.\r\n\r\n-Tingkatkan mobilitas patroli, pantau titik2  rawan di masing masing  dan obyek rawan\r\n\r\n-Sigap dan tanggap pada saat melaksanakan tugas.\r\n\r\n-Tingkatkan disiplin kerja dan kerja sama team  \r\n\r\n-laporkan kejadian sekecil apapun kepada pimpinan pada kesempatan pertama \r\n\r\n-jaga kesehatan jasmani dan rokhani\r\n-membahas masalah parkiran untuk staf dan karyawan\r\n\r\n- jaga kebersihan dalam pos dan area sekitar pos.\r\n\r\n-Timbang terima yang jelas sesuai situasi dan \r\nkondisi BIyang ada.\r\n\r\n-Pertahankan performa dari awal tugas sampai turun tugas(mulai dari ujung kaki sampai kepala)'),
