insert  into `news`(`news_id`,`news_type`,`news_branch_id`,`news_category_id`,`news_title`,`news_url`,`news_image`,`news_short`,`news_content`,`news_tags`,`news_keywords`,`news_visitor`,`news_user_id`,`news_date_created`,`news_date_updated`,`news_flag`,`news_position`,`news_json`) values 
(1,0,1,NULL,'About','about',NULL,'as','<p><b style=\"background-color: transparent; font-family: var(--font-family);\">TENTANG PERUSAHAAN</b><br></p><p><span class=\"fontstyle2\">Merupakan Perusahaan Lokal yang berdiri sejak 2022 dan memiliki asset seluas 2,7<br>hektar yang berlokasi di Martapura, Kab. Banjar</span></p><p><span class=\"fontstyle2\"><b>PRODUK DAN JASA</b></span></p><ul><li><span class=\"fontstyle2\"><b>Restaurant</b></span></li><li><span class=\"fontstyle2\"><b>Penginapan</b></span></li><li><span class=\"fontstyle2\"><b>Wisata</b></span></li></ul><p><span class=\"fontstyle2\"><b><br></b></span></p><table class=\"table table-bordered\"><tbody><tr><td><span style=\"font-weight: 700; color: rgb(111, 123, 138);\">VISI</span><br></td><td><span style=\"font-weight: 700; color: rgb(111, 123, 138);\">MISI</span><br></td></tr><tr><td><span style=\"color: rgb(111, 123, 138);\">Membangun hunian dengan melestarikan budaya Indonesia dan meningkatkan</span><br style=\"color: rgb(111, 123, 138);\"><span style=\"color: rgb(111, 123, 138);\">perkembangan Kab. Banjar</span><br></td><td><ol style=\"color: rgb(111, 123, 138);\"><li><span class=\"fontstyle2\">Mempertahankan hunian dengan melestarikan Budaya Nasional Indonesia</span></li><li><span class=\"fontstyle2\">Membangun Sumber Daya Manusia dalam bidang Hospitality di Martapura</span></li><li><span class=\"fontstyle2\">Memajukan Kab. Banjar sebagai salah satu destinasi wisata Kalimantan Selatan</span></li><li><span class=\"fontstyle2\">Memperhatikan aspek alam sebagai penunjang hunian yang ada di Kab. Banjar</span></li></ol></td></tr></tbody></table><p><span class=\"fontstyle2\"><b><br></b></span></p><p><img src=\"https://kampungnusantararesort.com/upload/file/restaurant.png\" style=\"width: 50%;\"><img src=\"https://kampungnusantararesort.com/upload/file/penginapan.jpg\" style=\"width: 525.607px; float: left; height: 243.302px;\" class=\"note-float-left\"><span class=\"fontstyle2\"><b><br></b></span><br style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-variant-position: normal; line-height: normal; text-align: -webkit-auto; text-size-adjust: auto;\"></p>','undefined','undefined',0,1,NULL,'2024-06-22 20:52:44',1,0,NULL),
(2,0,1,NULL,'Privacy','privacy',NULL,'Selamat datang di kampungnusantararesort.com. Kami menghargai privasi Anda dan berkomitmen untuk melindungi informasi pribadi yang Anda berikan kepada kami. Kebijakan privasi ini menjelaskan bagaimana kami mengumpulkan, menggunakan, dan melindungi informasi Anda.','<p style=\"margin-bottom: 18px; color: var(--text-color); line-height: 1.8; font-family: Epilogue, sans-serif; font-size: 16px;\"><span style=\"font-weight: bolder;\">Pembaruan Terakhir: 21 Juni 2024&nbsp;</span></p><p style=\"margin-bottom: 18px; color: var(--text-color); line-height: 1.8; font-family: Epilogue, sans-serif; font-size: 16px;\">Selamat datang di kampungnusantararesort.com. Kami menghargai privasi Anda dan berkomitmen untuk melindungi informasi pribadi yang Anda berikan kepada kami. Kebijakan privasi ini menjelaskan bagaimana kami mengumpulkan, menggunakan, dan melindungi informasi Anda.</p><p style=\"margin-bottom: 18px; color: var(--text-color); line-height: 1.8; font-family: Epilogue, sans-serif; font-size: 16px;\"><span style=\"font-weight: bolder;\">1. Informasi yang Kami Kumpulkan</span></p><p style=\"margin-bottom: 18px; color: var(--text-color); line-height: 1.8; font-family: Epilogue, sans-serif; font-size: 16px;\">Kami dapat mengumpulkan beberapa jenis informasi dari dan tentang pengguna situs kami, termasuk:</p><ul style=\"padding-left: 2rem; margin-bottom: 1rem; color: rgb(102, 102, 102); font-family: Epilogue, sans-serif; font-size: 16px;\"><li><span style=\"font-weight: bolder;\">Informasi Pribadi:</span>&nbsp;Nama, alamat email, nomor telepon, dan informasi kontak lainnya yang Anda berikan secara sukarela.</li><li><span style=\"font-weight: bolder;\">Informasi Non-Pribadi:</span>&nbsp;Data demografis, alamat IP, jenis perangkat yang digunakan, riwayat penelusuran, dan informasi lain yang tidak dapat mengidentifikasi Anda secara langsung.</li></ul><p style=\"margin-bottom: 18px; color: var(--text-color); line-height: 1.8; font-family: Epilogue, sans-serif; font-size: 16px;\"><span style=\"font-weight: bolder;\">2. Cara Kami Menggunakan Informasi Anda</span></p><p style=\"margin-bottom: 18px; color: var(--text-color); line-height: 1.8; font-family: Epilogue, sans-serif; font-size: 16px;\">Kami menggunakan informasi yang kami kumpulkan untuk berbagai tujuan, termasuk:</p><ul style=\"padding-left: 2rem; margin-bottom: 1rem; color: rgb(102, 102, 102); font-family: Epilogue, sans-serif; font-size: 16px;\"><li>Memberikan, mengoperasikan, dan memelihara situs web kami.</li><li>Memproses transaksi dan mengelola akun pengguna.</li><li>Mengirimkan komunikasi pemasaran dan promosi.</li><li>Meningkatkan situs web kami berdasarkan umpan balik Anda.</li><li>Menjawab pertanyaan dan menyediakan dukungan pelanggan.</li></ul><p style=\"margin-bottom: 18px; color: var(--text-color); line-height: 1.8; font-family: Epilogue, sans-serif; font-size: 16px;\"><span style=\"font-weight: bolder;\">3. Pembagian Informasi Anda</span></p><p style=\"margin-bottom: 18px; color: var(--text-color); line-height: 1.8; font-family: Epilogue, sans-serif; font-size: 16px;\">Kami tidak menjual, memperdagangkan, atau menyewakan informasi pribadi Anda kepada pihak ketiga. Kami dapat membagikan informasi Anda dengan pihak ketiga terpercaya yang membantu kami dalam mengoperasikan situs web kami, melakukan bisnis kami, atau melayani Anda, selama pihak-pihak tersebut setuju untuk menjaga kerahasiaan informasi ini.</p><p style=\"margin-bottom: 18px; color: var(--text-color); line-height: 1.8; font-family: Epilogue, sans-serif; font-size: 16px;\"><span style=\"font-weight: bolder;\">4. Perlindungan Informasi Anda</span></p><p style=\"margin-bottom: 18px; color: var(--text-color); line-height: 1.8; font-family: Epilogue, sans-serif; font-size: 16px;\">Kami mengambil langkah-langkah keamanan yang wajar untuk melindungi informasi pribadi Anda dari akses yang tidak sah, pengungkapan, perubahan, atau penghancuran. Namun, tidak ada metode transmisi data melalui internet atau metode penyimpanan elektronik yang sepenuhnya aman. Oleh karena itu, kami tidak dapat menjamin keamanan absolut.</p><p style=\"margin-bottom: 18px; color: var(--text-color); line-height: 1.8; font-family: Epilogue, sans-serif; font-size: 16px;\"><span style=\"font-weight: bolder;\">5. Cookies</span></p><p style=\"margin-bottom: 18px; color: var(--text-color); line-height: 1.8; font-family: Epilogue, sans-serif; font-size: 16px;\">Situs web kami dapat menggunakan \"cookies\" untuk meningkatkan pengalaman pengguna. Browser web pengguna menempatkan cookies di hard drive mereka untuk tujuan pencatatan dan kadang-kadang untuk melacak informasi tentang mereka. Anda dapat memilih untuk mengatur browser web Anda untuk menolak cookies atau memberi peringatan ketika cookies dikirim. Jika mereka melakukannya, perlu diketahui bahwa beberapa bagian situs web mungkin tidak berfungsi dengan baik.</p><p style=\"margin-bottom: 18px; color: var(--text-color); line-height: 1.8; font-family: Epilogue, sans-serif; font-size: 16px;\"><span style=\"font-weight: bolder;\">6. Hak Privasi Anda</span></p><p style=\"margin-bottom: 18px; color: var(--text-color); line-height: 1.8; font-family: Epilogue, sans-serif; font-size: 16px;\">Bergantung pada yurisdiksi Anda, Anda mungkin memiliki hak tertentu terkait informasi pribadi Anda, seperti hak untuk mengakses, mengoreksi, atau menghapus informasi pribadi Anda. Untuk menggunakan hak-hak ini, Anda dapat menghubungi kami di&nbsp;<a rel=\"noreferrer\" style=\"background-color: rgb(255, 255, 255); color: inherit; transition: all 0.4s ease 0s; font-family: inherit; font-size: inherit; font-weight: inherit; line-height: inherit;\">info@kampungnusantararesort.com</a>.</p><p style=\"margin-bottom: 18px; color: var(--text-color); line-height: 1.8; font-family: Epilogue, sans-serif; font-size: 16px;\"><span style=\"font-weight: bolder;\">7. Perubahan pada Kebijakan Privasi</span></p><p style=\"margin-bottom: 18px; color: var(--text-color); line-height: 1.8; font-family: Epilogue, sans-serif; font-size: 16px;\">Kami dapat memperbarui kebijakan privasi ini dari waktu ke waktu. Kami akan memberi tahu Anda tentang perubahan dengan memposting kebijakan privasi yang baru di situs web kami. Anda disarankan untuk meninjau kebijakan privasi ini secara berkala untuk setiap perubahan.</p><p style=\"margin-bottom: 18px; color: var(--text-color); line-height: 1.8; font-family: Epilogue, sans-serif; font-size: 16px;\"><span style=\"font-weight: bolder;\">8. Kontak Kami</span></p><p style=\"margin-bottom: 18px; color: var(--text-color); line-height: 1.8; font-family: Epilogue, sans-serif; font-size: 16px;\">Jika Anda memiliki pertanyaan tentang kebijakan privasi ini, praktik situs web kami, atau interaksi Anda dengan situs web ini, silakan hubungi kami di:</p><p style=\"margin-bottom: 18px; color: var(--text-color); line-height: 1.8; font-family: Epilogue, sans-serif; font-size: 16px;\"><span style=\"font-weight: bolder;\">Email:</span>&nbsp;<a rel=\"noreferrer\" style=\"color: inherit; transition: all 0.4s ease 0s; font-size: inherit; font-family: inherit; font-weight: inherit; line-height: inherit;\">info@kampungnusantararesort.com</a><br><span style=\"font-weight: bolder;\">Situs Web:</span>&nbsp;kampungnusantararesort.com</p>','undefined','undefined',0,1,NULL,'2024-06-21 21:50:48',1,1,NULL),
(3,0,1,NULL,'Term Of Service','term-of-service',NULL,NULL,'<p><strong>Pembaruan Terakhir: 21 Juni 2024</strong></p><p>Selamat datang di kampungnusantararesort.com. Dengan mengakses dan menggunakan situs web ini, Anda menyetujui untuk terikat dengan Syarat dan Ketentuan berikut. Jika Anda tidak setuju dengan syarat ini, mohon jangan menggunakan situs web kami.</p><p><strong>1. Penggunaan Situs Web</strong></p><p>Anda setuju untuk menggunakan situs web ini hanya untuk tujuan yang sah dan dengan cara yang tidak melanggar hak-hak orang lain atau membatasi atau menghambat penggunaan dan kenikmatan orang lain terhadap situs ini. Perilaku terlarang termasuk melecehkan atau menyebabkan kesusahan atau ketidaknyamanan kepada pengguna lain, mengirimkan konten cabul atau menyinggung, atau mengganggu aliran normal dialog di dalam situs kami.</p><p><strong>2. Akses ke Situs</strong></p><p>Kami berusaha untuk memastikan bahwa situs ini tersedia sepanjang waktu, namun kami tidak bertanggung jawab jika, untuk alasan apapun, situs ini tidak tersedia pada waktu tertentu. Kami dapat menangguhkan akses ke situs ini sementara tanpa pemberitahuan dalam kasus kegagalan sistem, pemeliharaan, atau perbaikan atau karena alasan di luar kendali kami.</p><p><strong>3. Hak Kekayaan Intelektual</strong></p><p>Semua konten di situs ini, termasuk tetapi tidak terbatas pada teks, grafis, logo, ikon, gambar, klip audio, dan perangkat lunak, adalah milik kampungnusantararesort.com atau penyedia konten kami dan dilindungi oleh undang-undang hak cipta internasional. Anda tidak diizinkan untuk memodifikasi, menyalin, mendistribusikan, mengirim, menampilkan, melakukan, mereproduksi, mempublikasikan, melisensikan, membuat karya turunan dari, mentransfer, atau menjual konten apa pun dari situs ini tanpa izin tertulis sebelumnya dari kami.</p><p><strong>4. Link ke Situs Web Pihak Ketiga</strong></p><p>Situs ini mungkin berisi tautan ke situs web pihak ketiga yang tidak dioperasikan oleh kampungnusantararesort.com. Kami tidak mengontrol situs-situs tersebut dan tidak bertanggung jawab atas konten atau kebijakan privasi mereka. Penyertaan tautan tersebut tidak menyiratkan dukungan atau rekomendasi oleh kami dan Anda mengakses situs web pihak ketiga tersebut dengan risiko Anda sendiri.</p><p><strong>5. Pembatasan Tanggung Jawab</strong></p><p>Konten yang ditampilkan di situs ini disediakan tanpa jaminan, kondisi, atau garansi apapun terhadap keakuratannya. Sejauh diizinkan oleh hukum, kami, pemasok konten dan penyedia kami, dengan ini secara tegas mengecualikan:</p><ul><li>Semua kondisi, jaminan, dan ketentuan lain yang mungkin tersirat oleh undang-undang, hukum umum, atau hukum ekuitas.</li><li>Setiap tanggung jawab untuk kerugian atau kerusakan langsung, tidak langsung, atau konsekuensial yang ditimbulkan oleh pengguna sehubungan dengan situs web kami atau sehubungan dengan penggunaan, ketidakmampuan untuk menggunakan, atau hasil penggunaan situs web kami, situs web yang tertaut ke dalamnya, dan materi yang diposting di dalamnya, termasuk, tanpa batasan, tanggung jawab untuk kehilangan pendapatan atau pendapatan, kehilangan bisnis, kehilangan keuntungan atau kontrak, kehilangan penghematan yang diantisipasi, kehilangan data, kehilangan goodwill, kehilangan waktu manajemen atau kantor, dan untuk setiap kerugian atau kerusakan lainnya.</li></ul><p><strong>6. Perubahan pada Syarat dan Ketentuan</strong></p><p>Kami dapat merevisi syarat dan ketentuan ini kapan saja dengan mengamandemen halaman ini. Anda diharapkan untuk memeriksa halaman ini dari waktu ke waktu untuk memperhatikan setiap perubahan yang kami buat, karena syarat dan ketentuan ini mengikat Anda.</p><p><strong>7. Hukum yang Berlaku</strong></p><p>Syarat dan ketentuan ini diatur dan ditafsirkan sesuai dengan hukum negara [Negara Anda], dan setiap perselisihan yang timbul dari atau terkait dengan syarat dan ketentuan ini akan tunduk pada yurisdiksi eksklusif pengadilan negara tersebut.</p><p><strong>8. Kontak Kami</strong></p><p>Jika Anda memiliki pertanyaan tentang syarat dan ketentuan ini, praktik situs web kami, atau interaksi Anda dengan situs web ini, silakan hubungi kami di:</p><p><strong>Email:</strong> <a rel=\"noreferrer\">info@kampungnusantararesort.com</a><br><strong>Situs Web:</strong> kampungnusantararesort.com</p>','undefined','undefined',0,1,NULL,'2024-06-21 21:56:49',1,1,NULL),
